from typing import List

class Solution:
    def singleNumber(self, nums: List[int]) -> List[int]:
        ''' Let's assume that only a and b occur exactly once, and the rest occur exactly twice.
            If c is the XOR of the entire list, then c = a ^ b. Find out the rightmost position
            of 1 in c. Let's say c = 11000100 then rightmost position is 3 from the right. Now,
            at this position, there must be an odd number of 1s in the entire list. And one of
            those elements must be a or b.
        '''
        xor = 0
        for n in nums:
            xor ^= n
        c = xor
        pos = 0
        while c & 1 != 1:
            c = c >> 1
            pos += 1
        xor1 = xor
        for n in nums:
            num = n
            for _ in range(pos):
                num = num >> 1
            if num & 1 == 1:
                xor1 ^= n
        return [xor1, xor1 ^ xor]

